description:
Kak raz to, chto nado utrom 1 janvarja.. 
Golovolomnaja arkada, v kotoroj vam neobhodimo dostavljat' vsevozmozhnye gruzy po morju, preodolevaja razlichnye prepjatstvija. No snachala gruz nuzhno budet jeffektivno ulozhit' na palube i pravil'no zakrepit', chtoby dostavit' ego v punkt naznachenija v celosti i sohrannosti. Nepogoda i morskaja zhivnost' budut aktivno starat'sja vam v jetom pomeshat'.
